/**
 * Actions are constants use by the stores, actions, and sagas to identify event types.
 *
 * @type {{BUTTON_BARS: {FETCH: string, SAVE: string, UPDATE: string}}}
 */
const ACTIONS = {
  BUTTON_BARS: {
    FETCH: 'buttonBars.fetch',
    SAVE: 'buttonBars.save',
    UPDATE: 'buttonBars.update'
  }
  // @TODO: [PAS] - it wound be very nice to include messages from the server, this would include errors and requests in flight.
  // MESSAGE: {
  //   SAVE: 'message.save',
  //   IS_ERROR: 'message.is_error',
  //   IN_FLIGHT: 'message.in_flight'
  // }
};

export { ACTIONS as default };

import ACTIONS from './actionTypes/index';

/**
 * Initiate the workflow by making request for the button bars data.
 * @function
 * @return {action}
 */
export const fetchData = () => ({
  type: ACTIONS.BUTTON_BARS.FETCH
});

/**
 * Save the data into the store. This is a destructive operation.
 * @function
 * @param {{ buttons: [number], bars: [number] }} data - the data to store.
 * @return {action}
 */
export const saveData = data => ({
  type: ACTIONS.BUTTON_BARS.SAVE,
  value: data
});

/**
 * Update the given Bar by index, adding the given percentage to the value. This could be a negative number, decrementing the value.
 * @function
 * @param {{index:number,percentage:number}} data - the data to store.
 * @return {action}
 */
export const updateBar = (data) => ({
  type: ACTIONS.BUTTON_BARS.UPDATE,
  value: data
});

import PropTypes from 'prop-types';
import React, { Component } from 'react';

/**
 * A basic Button Class used for creating html buttons.
 *
 * @class
 */
class Button extends Component {

  /**
   * Constructor
   * @constructor
   * @param {number|string} props.value - the value to pass the <code>onClickHandler</code>
   * @param {function} props.onClickHandler - On click handler
   */
  constructor(props) {
    super(props);
    this.displayName = 'components/Button';
    this.onClickHandlerProxy = this.onClickHandlerProxy.bind(this);
  }

  /**
   * On click handler proxy, which forwards on the prop's value to the <code>onClickHandler</code> attached to the <code>props</code.
   */
  onClickHandlerProxy() {
    this.props.onClickHandler(this.props.value);
  }

  /**
   * Standard React Render method
   * @returns {XML}
   */
  render() {
    let { value } = this.props;

    return (
      <button type='button' onClick={this.onClickHandlerProxy} tabIndex={0} data-component-name={this.displayName}>{value}</button>
    );
  }
}

Button.propTypes = {
  value: PropTypes.oneOfType([
    PropTypes.number,
    PropTypes.string
  ]).isRequired,
  onClickHandler: PropTypes.func.isRequired
};

export default Button;

