import PropTypes from 'prop-types';
import React, { Component } from 'react';

/**
 * @typedef {Object} event - a dom event
 * @property {Object} target - a dom target.
 * @property {*} target.value - the value
 */

/**
 * A basic Select Class used for creating html select tags.
 *
 * @class
 */
class Select extends Component {

  /**
   * Constructor
   * @param {Object} props - basic Properties object
   * @param {number|string} props.value - the value to pass the <code>onClickHandler</code>
   * @param {onChangeHandler} props.onChangeHandler - On click handler which is passed the selected value.
   * @constructor
   */
  constructor(props) {
    super(props);
    this.displayName = 'components/Select';
    this.onChangeHandlerProxy = this.onChangeHandlerProxy.bind(this);
  }

  /**
   * This proxy method, fires the call back defined in the props <code>onChangeHandler</code> and sends it the selected value.
   * @param {event} event
   */
  onChangeHandlerProxy(event) {
    this.props.onChangeHandler(event.target.value);
  }

  render() {
    let { name, value, children } = this.props;

    return (
      <select name={name} value={value} onChange={this.onChangeHandlerProxy} data-component-name={this.displayName} tabIndex={0}>{children}</select>
    );
  }
}

Select.propTypes = {
  name: PropTypes.string.isRequired,
  children: PropTypes.node, // PropTypes.arrayOf(),
  value: PropTypes.oneOfType([
    PropTypes.number,
    PropTypes.string
  ]).isRequired,
  onChangeHandler: PropTypes.func.isRequired
};

export default Select;

import PropTypes from 'prop-types';
import React, { Component } from 'react';
import { connect } from 'react-redux';
import { bindActionCreators } from 'redux';
import * as ButtonBarsActions from '../actionCreators/buttonBarsActions';
import Button from '../components/button/Button';
import Option from '../components/option/Option';
import ProgressBar from '../components/progressBar/ProgressBar';
import Section from '../components/section/Section';
import Select from '../components/select/Select';

/**
 * App Class, a container, wires all the components.
 *
 * Note: by using connect on the default export, I can pry open the class and wire it up by hand
 *
 * @class
 */
export class App extends Component {

  constructor(props) {
    super(props);
    this.displayName = 'containers/App';
    this.onChangeHandler = this.onChangeHandler.bind(this);
    this.onClickHandler = this.onClickHandler.bind(this);
    this.state = {
      selected: {
        index: 0
      }
    };
  }

  componentWillMount() {
    this.props.buttonBarsActionDispatcher.fetchData();
  }

  onChangeHandler(data) {
    this.setState({ selected: { index: data } });
  }

  onClickHandler(percentage) {
    this.props.buttonBarsActionDispatcher.updateBar({ index: this.state.selected.index, percentage });
  }

  render() {
    let { buttons, bars } = this.props;

    return (
      <div data-component-name={this.displayName}>
        <Section title="Progress Bars Demo" level={1}>
          {bars.map((percentage, i) => (<ProgressBar key={i} percentage={percentage} />))}
          <Select onChangeHandler={this.onChangeHandler} name='selected-progressbar'>
            {bars.map((percentage, i) => (<Option key={i} value={i} text={'#progress ' + (i+1)} />))}
          </Select>
          {buttons.map((percentage, i) => (<Button key={i} value={percentage} onClickHandler={this.onClickHandler} />))}
        </Section>
      </div>
    );
  }
}

App.defaultProps = {
  buttons: [],
  bars: []
};

App.propTypes = {
  buttons: PropTypes.array,
  bars: PropTypes.array,
  buttonBarsActionDispatcher: PropTypes.func.isRequired
};

let mapStateToProps = (state) => {
  return {
    buttons: state.buttonBarsReducer.get('buttons').toJS(),
    bars: state.buttonBarsReducer.get('bars').toJS()
  };
};

let mapDispatchToProps = (dispatch) => {
  return {
    buttonBarsActionDispatcher: bindActionCreators(ButtonBarsActions, dispatch)
  };
};

// Note: by using connect on the default export, I can pry open the class and wire it up by hand
export default connect(mapStateToProps, mapDispatchToProps /**, mergeProps **/)(App);

